import Link from 'next/link';

const Nosotros = () =>(
    <div>
    <ul>
        <li><Link href='/'><a>Inicion</a></Link></li>
        <li><Link href='/nosotros'><a>Nosotros</a></Link></li>

    </ul>
    <p> Hola mundo desde nosotros</p>

    </div>
)

export default Nosotros;
